import { FormHelperText } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles'

export default makeStyles(() => ({
    appBar: {
        borderRadius: 20,
        margin: '30px 0',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
    },
    heading: {
        color: 'rgba(188, 189, 255, 1)',
    },
    image: {
        marginLeft: '15 px'
    }
}));
